REPLACE INTO `retrospective_entries` (`id`, `entry_text`, `key_point`, `line_number`, `retrospective_id`) VALUES
	(97, 'Only 1 promo payment on Friday. We\'re improving on the promo payments which I think is a good win!', b'1', 1, 20),
	(98, 'Issue this week was forcing trades. I keep entering the market because I think I see something but I\'m really just convincing myself of something that isn\'t there. I end to be okay with the idea that I might not enter the market for a whole day.', b'0', 2, 20),
	(99, 'Re-entering immediately after a losing position is a low probability play and I should avoid doing it. I\'ve been having issues with consecutive compound losses.', b'0', 3, 20),
	(100, 'My rules work and are generating profits. I just need to continue sticking to them. ', b'0', 4, 20),
	(101, 'Stick to your rules and plan, they will bring us to the end of the road!', b'1', 5, 20),
	(107, 'Emotional week where I was over-trading. The good news is that I have the skill ti trade and play this game. I have good technical analysis. I need to focus on using the areas of value to guide my entries.', b'0', 1, 16),
	(108, 'Need to focus on my take profit levels. I shouldn\'t be aiming for the starts. The stops have helped me, now let\'s work on my targets.', b'0', 2, 16),
	(109, 'My skill continues to grow. I can do this. I just to need remember my rules and plan.', b'0', 3, 16),
	(110, 'Discipline needs to be maintained by focusing on my rules and plan!', b'1', 4, 16),
	(111, 'This week I displayed great skill at finding nice and lucrative trades. I\'m proud that my technical education is bearing fruit so I should take that as a big positive.', b'0', 1, 15),
	(112, 'My mental game needs some work. I have books that should help but I need to work on my patience. Another big one is to stop worrying about the money and the future. I can\'t get there if I don\'t perform and focus on now.', b'0', 2, 15),
	(113, 'This coming week I will focus on a good mental game and improve my ability to pick directions. Let\'s get it.', b'0', 3, 15),
	(114, 'Mental game needs work, focus on the now not the future. Don\'t get caught up with money and numerical amounts', b'1', 4, 15),
	(115, 'Overall the week was good since I maintained my goals. I\'m showing good skill at making nice trades. I should be proud of that', b'0', 1, 4),
	(116, 'My losses are too big. I need to enter each trade with hard-coded stop losses. Had I kept my losses smaller I\'d hit my targets sooner and stay out of the market faster.', b'0', 2, 4),
	(117, 'Good entries and exits, need to work on stops and I\'ll be in good shape. Looking forward to next week.', b'0', 3, 4),
	(118, 'Focus on better stop losses on each trade, reduce the size of my losses!', b'1', 4, 4),
	(119, 'Finished the week with nice profits but I did ignore some losses. Making the switch to trade only with-trend was a great decision. It kept me on the right side of the market.', b'0', 1, 3),
	(120, 'My entries were in the right direction but too early. The drawdowns are too high. I need to be more selective and quicker to exit.', b'0', 2, 3),
	(121, 'I need to set up better trades with protective stops. My losses are too high. I should follow my rules of only entering on highs and lows of candles', b'0', 3, 3),
	(122, 'Overall good first week, looking forward to the next week. Need to keep my head in the game and better time my entries. I can do this', b'0', 4, 3),
	(123, 'Losses too high. Need protective stops.', b'1', 5, 3),
	(124, 'Difficult week emotionally. Some big bull trend days but I kept going counter-trend expecting the big dump. This isn\'t a sustainable way of trading. Wasn\'t following my rules and I payed the price for it.', b'0', 1, 18),
	(125, 'Show nice skill to dig myself out of big holes. This indicates that I have the skill to win at this game. I need to focus on accepting the always-in direction and to not aim for big dumps. My trades need to aim for small, consistent gains and not Hail Mary\'s!!!', b'0', 2, 18),
	(126, 'Need to be more impartial to market direction. Stay with the trend. 25 EMA will protect me.', b'0', 3, 18),
	(127, 'Focus on reading the chart for what it is and not what I think it will be. The answer is always in front of me', b'1', 4, 18),
	(128, '* 2 days were write-offs and Monday was a holiday: Labor Day', b'1', 5, 18),
	(129, 'Start of a new month where I was supposed to go live, I\'m glad I didn\'t. I\'m still not taking it seriously enough. Still predicting too much and not enough reacting. I\'m getting distracted by outside noise.', b'0', 1, 17),
	(130, 'I have the skill to get in on the big moves, just need to improve my entries. Higher lot sizes with some volatility mean that I need to focus on good entries. I\'ve lost a few on tight stops.', b'0', 2, 17),
	(131, 'The promo payments need to stop, they\'re not sustainable. It\'s a sign that I\'m not taking it seriously. Enter with stops and we\'ll cut them out', b'0', 3, 17),
	(132, 'Take paper trading more seriously!', b'1', 4, 17),
	(133, 'Reduce promo payments, they\'re not going to be there during go-live', b'1', 5, 17),
	(134, 'This week I showed new skills of multi-trading. I need to lower my position sizes. Choppy markets kill me with full position sizing.', b'0', 1, 21),
	(135, 'Getting very tilted and posting consecutive losses because I can\'t handle being wrong. I need to lower my position sizes to reduce emotion and tilt and look for multi-entries.', b'0', 2, 21),
	(136, 'Stick to the always-in direction and trade near areas of value. Smaller position sizes and accept that I can and will be wrong', b'0', 3, 21),
	(137, 'I need to stop being in a rush. I force trades because I\'m impatient and want to be finished.', b'0', 4, 21),
	(138, 'I tend to focus on numerical profit amounts and miss take profits because I push them too far to make up for previous losses. I am over-trading and need to relax. Lower my position size! It will make me more profitable', b'0', 5, 21),
	(139, 'Lower position sizes !!', b'1', 6, 21),
	(140, 'I wrote off 1 day for emotional instability. I am confident of my ability to handle myself better moving forward.', b'1', 7, 21),
	(141, 'Overall strong week for trading. When following my structured approached I tend to have the most success. Need to focus on keeping things mechanical', b'0', 1, 22),
	(142, 'Emotions will creep up, need to focus on my technique and technical skills to keep me grounded and focus on what the chart is telling me and not what I think / want it to tell me', b'0', 2, 22),
	(143, 'Not much to say about this week overall. Small position sizes continue to be very important', b'0', 3, 22),
	(144, 'Small position sizes coupled with levels & zones will keep the gains consistent', b'1', 4, 22),
	(145, 'Very difficult trading week which was unfortunate considering the prior week was a strong one. I was unstable emotionally, probably creeped in from my personal life during the weekend.', b'0', 1, 23),
	(146, 'Confidence has been shaky. I don\'t feel like I even have a strategy, sort of feel lost and insecure about what I\'m doing.', b'0', 2, 23),
	(147, 'Had some discipline issues this week, not following my rules. Probably a result of my lack of confidence.', b'0', 3, 23),
	(148, 'Need to be up and awake before the market opens. Have to prioritize pre & post-market routines', b'0', 4, 23),
	(149, 'Struggled with emotional consistency and discipline. Lacked confidence with my strategy', b'1', 5, 23),
	(150, 'Need to focus on my system that I\'ve built with my experience, celebrate my skill and accept my mistakes as areas of improvement', b'1', 6, 23),
	(151, 'I need to be better with my pre & post-market routines. Prep work is extremely important and will keep me on the right side of the market', b'1', 7, 23);
